import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Wait for the product cards to be rendered by the script
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Locate all product price elements
    const priceLocators = page.locator('.product-price');
    await priceLocators.first().waitFor({ timeout: 5000 });

    // Take a screenshot of the products section
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_visible.png'));

    // Extract the text content from all price elements
    const priceTexts = await priceLocators.allInnerTexts();

    // Clean the extracted text to get only the numerical price values
    const prices = priceTexts.map(text => {
      // The text might be like "$1199.99 $1299.99". We only want the first price.
      const priceString = text.split('\n')[0].split(' ')[0].replace('$', '').trim();
      return parseFloat(priceString);
    }).filter(price => !isNaN(price)); // Filter out any potential NaN values

    return {
      success: true,
      action: "Extracted all product prices from the page.",
      extractedData: {
        productCount: prices.length,
        prices: prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
    screenshots.push(path.join(screenshotsDir, 'error_screenshot.png'));

    return {
      success: false,
      action: "Failed to extract product prices.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
